package mrhamzaless.com.atrap.cache;

public class TrapCache {
    private String key1;
    private String value;

    public TrapCache(String key1, String value) {
        this.key1 = key1;
        this.value = value;
    }

    public String getKey1() {
        return key1;
    }

    public String getValue() {
        return value;
    }



}

